}

#[test]
fn test_date_ne() {
    let date = Date::new(2023, 1, 1);

    assert(!date.ne(Date::new(2023, 1, 1)));
    assert(date.ne(Date::new(2023, 1, 2)));
}

#[test]
fn test_date_gt() {
    let date = Date::new(2023, 1, 1);

    assert(!date.gt(Date::new(2023, 1, 1)));
    assert(!date.gt(Date::new(2023, 1, 2)));
